{"product_url": "http://www.target.com/p/dyson-dc58-handheld-vacuum-cleaner/-/A-15033641", "source_site": "target.com", "description": ["    \n  \t\t     \tThe Dyson DC58 handheld is powered by the latest in Dyson digital motor technology. The Dyson digital motor v6 is a digitally controlled motor that spins up to 3 times faster than conventional motors and generates high constant suction. ", " 15 cyclones arranged across two tiers work in parallel to generate high centrifugal forces that spin fine dust out of the airflow\u2014straight into the bin.. ", " In boost mode, the DC58 has 50% more power than the DC34. ", " The DC58 handheld weighs less than 4 lbs. The ergonomic design of the handle fits naturally into the shape of the hand. ", " It includes a charger, a combination tool for dusting and a crevice tool for tight spaces in the home, car or boat. ", " The DC58 handheld is covered by a 2-year warranty, parts and labor.", "Powered by the Dyson digital motor V6: Up to 3x faster than conventional motors.", "2 Tier Radial\u0099 Cyclones: 15 cyclones, arranged in two teirs, work in parallel to increase airflow and capture fine dust", "Ergonomically fits into the shape of the hand: Center of gravity located towards the grip for easy handling", "In car cleaning: Cleans footwells, upholstery and beneath car seats", " Lifetime Filter, Bagless, Rechargeable Battery, Cordless, Cyclonic Action, Light Weight, Easy Empty Dirt Container", " Charger, Washable Filter, On Board Accessories, Accessory Storage Caddy, Crevice Tool, Wall Mounting Kit, Owner's Manual", " Multi-Surface", " HEPA", " Bagless", " 2", " 20 Minutes", " 0.12 Gal.", " 0. M", " Stair Tool, Crevice Tool", " 120 Watts", " 3.4 Lb.", " Required, included", " no assembly required"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/15033641?wid=410&hei=410"], "product_item_num": "15033641", "list_price": "$199.99", "product_title": "Dyson DC58 Handheld Vacuum Cleaner"}
{"product_url": "http://www.target.com/p/dyson-dc39-animal-canister-vacuum-w-tangle-free-turbine-tool-iron-purple/-/A-14497065", "source_site": "target.com", "description": ["    \n  \t\t     \tDesigned for pet owners, the DC39 Animal canister vacuum is engineered with cyclones that capture more dirt than any other. Featuring Dyson\u2019s Radial Root Cyclone\u2122 technology, reconfigured air channels reduce turbulence and preserve air pressure within inner cyclones to extract more dirt, allergens and pet hair.  ", "  ", " Suitable for all floor types, the DC39\u2019s Triggerhead tool is the only turbine head controlled at the handle, so there is no bending down to adjust. A fingertip control switches the brush bar off for delicate rugs and hard floors and switches on for high pick-up on carpets.  It also features a detachable handle, which allows you to fit tools directly to the end of the hose, for cleaning in confined places. The included Tangle-free Turbine tool is the only turbine tool that doesn\u2019t tangle.  Counter-rotating heads with brushes remove hair and dirt.  A clean air turbine provides the flexible heads with constant power over uneven surfaces.  There\u2019s no brush bar for hair to wrap around, it\u2019s released straight into the bin.  The DC39 is also the only canister vacuum with a central steering mechanism. Combined with Dyson Ball\u2122 technology, the DC39 turns on a dime to give you greater control. Ball profile creates low friction, so the machine flows around obstacles and the smooth edges of the ball don\u2019t dig into the carpet pile.  The clear bin, made from tough polycarbonate allows you to see when it\u2019s full and empties at the push of a button, minimizing contact with dirt and allergens. ", "  ", " DC39 Animal has a non-removable HEPA filter and no extra costs from bags, belts or filters. The machine carries a 5 year warranty, parts and labor guaranteed by Dyson.  And as with all Dyson vacuum cleaners, DC39 Animal has no loss of suction.", " Pet Hair Pick-Up", " On Board Accessories, Crevice Tool", " Carpet, Multi-Surface", " HEPA", " Bagless", " 10.2 \"", " TurboBrush", " 16.5 Lb.", " assembly required, no tools needed"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/14497065?wid=410&hei=410"], "product_item_num": "14497065", "list_price": "$399.99", "product_title": "Dyson DC39 Animal Canister Vacuum w/Tangle Free Turbine Tool - Iron/Purple"}
{"product_url": "http://www.target.com/p/black-decker-18v-cordless-pivoting-hand-vac-phv1810/-/A-10300188", "source_site": "target.com", "description": ["    \n  \t\t     \tThe Black & Decker PHV1810 pivot handheld vacuum utilizes powerful cyclonic action that spins dust away from the filter, ensuring strong, constant suction power. This vacuum cleaner has the AccuREACH pivoting nozzle for vacuuming tricky corners and tight spaces. This pivoting action can be set to 10 different positions for lifting dust and debris at a variety of angles. With a 3-stage filtration system and a pleated filter design, this rechargeable vacuum cleaner minimizes clogging and helps improve air exhaust. Its wide-cleaning head quickly picks up large debris. It comes with a removable, washable dirt bowl and filters. The translucent dirt bowl lets you see when it needs to be emptied. This Black & Decker 18V cordless pivoting hand vac has an on-board brush and extendable crevice tool for flexibility and easy cleaning. It comes with a home charging base to keep it powered for the next use.", "Patented pivoting action locks in 10 positions for targeted cleaning", " Rechargable", " Home Charging Base", " Multi-Surface", " Standard", " 17 minutes", " 21.0 Oz.", " 3.0 \"", " Upholstery Tool", " 6.0 Lb."], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/10300188?wid=410&hei=410"], "product_item_num": "10300188", "list_price": "$48.99", "product_title": "Black & Decker 18V Cordless Pivoting Hand Vac, PHV1810"}
