{"product_url": "http://www.target.com/p/dyson-dc50-animal-upright-vacuum-closeout/-/A-14545425", "source_site": "target.com", "description": ["    \n  \t\t     \tDC50 Animal is Dyson\u2019s lightest upright vacuum. It weighs just 11.6lbs and performs like a full-size upright. The technology inside has not simply been concentrated \u2013 every angle and dimension re-engineered for improved performance. ", "  ", " Dyson DC50 Animal has advanced cleaner head technology.  It includes a self-adjusting base plate for optimal contact on every floor type, a brush bar with anti-static carbon fiber bristles to remove fine dust from hard floors and stiff nylon bristles to remove ground-in dirt from carpets. ", "  ", " Like all Dyson vacuums, DC50 Animal has no bag, so there\u2019s no loss of suction. Instead, patented cyclone technology spins dust and dirt from the air. With 2 Tier Radial\u2122 cyclones, DC50 Animal has 19 cyclones that work in parallel across two tiers to increase airflow and capture more microscopic dust from the home.  ", "  ", " Unlike ordinary upright vacuum cleaners, DC50 Animal rides on a ball. It turns on the spot, steering easily around furniture and into difficult places. DC50 Animal has Dyson\u2019s latest Ball\u2122 technology. Even more of the machine\u2019s key components are located inside the ball itself. This reduces clutter on the outside of the machine, streamlining its profile.  ", "  ", " DC50 Animal comes with the Tangle-free Turbine tool. It\u2019s the only turbine tool that doesn\u2019t tangle. Counter-rotating heads with brushes remove hair and dirt from carpets and upholstery. There\u2019s no brush bar for hair to wrap around.", " Bagless, Lifetime Filter", " On Board Accessories", " Multi-Surface", " Standard", " Bagless", " 1", " 11.0 \"", " 11.6 Lb.", "\n\t\t\t   \t\t\t\n\t\t\t   \t\t\t\n\t\t\t   \t\t\t", "\n\t\t\t   \t\t\t\n\t\t\t   \t\t\t\n\t\t\t\t\t    \t\n\t\t\t\t\t       \t\n\t\t\t\t\t    \t\t\n\t\t  \t\t    \t\t\t\n\t\t  \t\