{"product_url": "http://www.target.com/p/dyson-dc39-canister-vacuum/-/A-15250309", "source_site": "target.com", "description": ["    \n  \t\t     \tThe DC39 Origin canister vacuum is engineered with Dyson cyclones that capture more dirt than any other. Featuring Dyson's Radial Root Cyclone\u2122 technology, reconfigured air channels reduce turbulence and preserve air pressure, so the inner cyclones can extract more microscopic particles and expel cleaner air. Suitable for all floor types, the DC39's Triggerhead tool is the only turbine head controlled at the handle, so there is no bending down to adjust. A fingertip control switches the brush bar off for delicate rugs and hard floors and switches on for high pick-up on carpets.  It also features a detachable handle, which allows you to fit tools directly to the end of the hose, for cleaning in confined places. The included combination tool and stair tool are designed for dusting and removing dirt from corners and vertical edges of stairs.  The DC39 is also the only canister vacuum with a central steering mechanism. Combined with Dyson Ball\u2122 technology, the DC39 turns on a dime to give you greater control and easily moves around obstacles. The smooth chassis profile means no rough edges to snag or catch on carpet pile. The clear bin, made from tough polycarbonate, allows you to see when it's full and empties at the push of a button, minimizing contact with dirt and allergens.DC39 Origin has a non-removable HEPA filter and no extra costs from bags, belts or filters. The machine carries a 5 year warranty, parts and labor guaranteed by Dyson.", " Multi-Surface Cleaner, Easy Empty Dirt Container, Bagless, Lifetime Filter, Retractable Cord, built-in extension wand, Non-Stop Suction", " On Board Accessories", " Hardwood, Carpet, Multi-Surface, Hard Floor", " HEPA", " Bagless", " 1", " 0.53 Gal.", " 10.4 \"", " Crevice Tool, Dusting Brush, Stair Tool", " 275 Watts", " 16.89 Lb.", " no battery used", " assembly required, no tools needed"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/15250309?wid=410&hei=410"], "product_item_num": "15250309", "list_price": "$324.99", "product_title": "Dyson DC39 Canister Vacuum"}
{"product_url": "http://www.target.com/p/dyson-dc40-origin-yellow/-/A-14877915", "source_site": "target.com", "description": ["    \n  \t\t     \tDC40 is a lightweight upright vacuum featuring Dyson Ball\u2122 technology; enabling it to navigate around furniture and tight spaces. DC40 features Radial Root Cyclone\u2122 technology, which means it has remodeled airflows to maximize suction power, and a cleaner head that self-adjusts for optimal contact with all floor types. ", "  ", " DC40 Origin features Radial Root CycloneTM technology that maximizes suction power for no loss of suction. A mesh shroud helps separate large debris while the inner cyclones generate powerful centrifugal forces, extracting microscopic particles like pollen and mold. It also features a self-adjusting cleaner head--the base plate automatically adapts to all floor surfaces, creating a seal to remove dust from carpets and hard floors, while protecting delicate surfaces. Long bristles penetrate deep into carpet to remove ground-in dirt. Shorter bristles sweep the carpet to remove surface dust, fibers and pet hair. DC40 Origin has BallTM technology. Ducting on the outside of the ball has been miniaturized to fit inside the ball, making it easier to steer around furniture. ", "  ", " The DC40 Origin is engineered with materials that are selected for their strength and durability. ", " Additionally, this vacuum comes with a combination tool that has soft bristles for gentle dusting and a stair tool for removing dirt and dust from corners and vertical edges of stairs. It also includes a 5 year warranty, parts and labor guaranteed by Dyson.", " Bagless", " Brush Cleaning Tool, Crevice Tool", " Hardwood, Carpet, Hard Floor, Multi-Surface", " HEPA", " Bagless", " 1", " 0.42 Gal.", " 12.2 \"", " Brush Tool", " 120 Watts", " 14.6 Lb.", " no battery used no battery included", " assembly required, no tools needed", "\n\t\t\t   \t\t\t\n\t\t\t   \t\t\t\n\t\t\t   \t\t\t", "\n\t\t\t   \t\t\t\n\t\t\t   \t\t\