{"product_url": "http://www.target.com/p/dyson-dc65-animal-upright-vacuum/-/A-15046629", "source_site": "target.com", "description": ["    \n  \t\t     \tDC65 is the most powerful upright vacuum on a ball, with twice the suction of any other vacuum*. It uses Radial Root Cyclone\u2122 technology and a reconfigured brush bar to remove more dirt and dust from the home. The redesign of the brush bar means that the bristles have been made shorter and stiffer allowing deeper carpet penetration to remove more dirt, while maintaining superior performance on hard floors.   ", "  ", " The DC65 cleans better than any other vacuum across carpets and hard floors**. It achieves this through the combination of Radial Root Cyclone\u2122 technology and a self adjusting cleaner head which seals in suction across carpets and hard floors.  ", "  ", " The latest Ball\u2122 technology allows easy steering into difficult places. More key technologies are housed inside the ball, reducing components on the outside of the machine. Removing clutter from around the ball makes it even easier to steer under and around furniture.   ", "  ", " Other vacuums have a choice of settings for different floor types. This means that when moving from one floor type to another, suction power can be wasted. DC65 has an active base plate which self adjusts to create optimal contact with every floor type. This reduces air leaks and retains more suction power at the cleaner head.  ", "  ", " Additionally, the DC65 Animal  includes a combination tool, stair tool and a Tangle-free Turbine tool for removing hair and dirt from upholstery. Also included is a 5-year warranty, parts and labor. ", " *Suction tested against upright market to ASTM F558 at the cleaner head, dust-loaded as per IEC 60312-1. ", " ** Tested against upright market, dust-loaded, using ASTM F608, ASTM F2607, and IEC 60312-1 5.1, 5.9.", "Radial Root Cyclone\u0099 technology", "Self adjusting cleaner head: Automatically adjust to seal in suction across carpets and hard floors", "Reconfigured brush bar: 25% more power drives bristles deeper into carpets removing more dirt", "Cleans better than any other vacuum across carpets and hard floors**", "Twice the suction* Dyson DC65 has twice the suction of any other vacuum", " Tangle free turbine tool, Bagless, Multi-Cyclonic, Lifetime Filter, built-in extension wand, On/Off Switch, Cord Storage, Brush On/Off Switch, detachable canister, Edge Cleaning", " On Board Accessories, Washable Filter, Extra Long Hose, Crevice Tool, Owner's Manual, Telescoping Extension Wand", " Carpet, Hardwood, Hard Floor, Multi-Surface", " HEPA", " Bagless", " 1", " 0.55 Gal.", " 13.4 \"", " Car Nozzle, Long Reach Hose, Telescope Reach Wand, Hose, Crevice Tool, Stair Tool", " 120 Watts", " 17.36 Lb.", " no battery used"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/15046629?wid=410&hei=410"], "product_item_num": "15046629", "list_price": "$499.99", "product_title": "Dyson DC65 Animal Upright Vacuum"}
