{"product_url": "http://www.target.com/p/dyson-dc34-handheld-vacuum-cleaner/-/A-13713878", "source_site": "target.com", "description": ["    \n  \t\t     \tDyson DC34 handheld cordless vacuum cleaner is designed for small tasks at home, work, or in your car. Powered by the Dyson digital motor and Root Cyclone\u2122 Technology, the DC34 is the most powerful handheld that doesn\u2019t lose suction. ", "  ", " Weighing just 2.9 lbs, the DC34 handheld is lightweight and easy to handle, without compromising on cleaning power. The Lithium-ion battery releases its charge evenly, with no drop-off as you clean. The dual power mode offers running time of either 15 minutes of high constant suction or 6 minutes of MAX power for more difficult tasks. An LED indicator on the battery flashes when there\u2019s less than 1 minute of power left. ", "  ", " Clear bin allows you to see when it\u2019s full, and is easily emptied with the push of a button minimizing contact with dirt and allergens. Made of tough, durable polycarbonate, the same material used to make crash helmets and dashboards, the DC34 is made to withstand bumps and bruises. DC34 includes a crevice tool and a combination accessory tool, as well as a 2 year parts and labor warranty.", " Rechargeable Battery, Cyclonic Action, Cordless", " Charger, Washable Filter, Crevice Tool, Owner's Manual, Rechargeable Battery", " Carpet, Hard Floor, Multi-Surface", " Standard", " Bagless", " 2", " 6-15 Minutes", " 0.9 Gal.", " 2.0 \"", " Crevice Tool, Stair Tool, Brush Tool", " 30 Watts", " 2.92 Lb.", " Required, included: 1 lithium ion"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/13713878?wid=410&hei=410"], "product_item_num": "13713878", "list_price": "$169.99", "product_title": "Dyson DC34 Handheld Vacuum Cleaner"}
