pes", " Unwanted Hair", " Electric", " Required, included", " Rinse with Water", " 2 Year Limited Warranty", " no warning applicable"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/15583605?wid=410&hei=410"], "product_item_num": "15583605", "list_price": "$179.99", "product_title": "Braun Series 5-5090cc Men's Shaving System"}
