{"product_url": "http://www.target.com/p/braun-cruzer-5-beard-and-head-trimmer/-/A-13470163", "source_site": "target.com", "description": ["    \n  \t\t     \tThe Braun cruZer 5 beard makes it remarkably easy to go from a neatly trimmed full beard to subtle designer stubble. Fully washable due its sealed body, the cruZer5 beard is a hassle-free and handy tool for easy styling and trimming. ", "  ", " ", " ", " No matter if you want to go for a cool designer stubble or full beard, the provided beard comb lets you choose from six different length settings (1-11mm). It comes with click&lock functionality to change your precise length setting at the touch of a finger \u2013 so forget about a big toolkit of different attachments you constantly have to change! ", "  ", " ", " ", " Without the comb on, you can use the cruZer5 beard's ultra sharp stainless steel trimming element to make your look complete. Give your trimmed beard clear outlines and add the finishing touches to your facial style. Adding this kind of additional contours will make all the difference between a slightly scraggy beard and a neat, tidy and trendy look.  ", "  ", " ", " ", " The trimmer is equipped with a powerful dual battery system that makes it easy to trim even tough beard hair. By keeping constant trimming power even on tough conditions, the cruZer5 beard ensures an even trim without the risk of irregularities. ", "  ", " ", " ", " The cruZer 5 beard & head comes with a completely sealed body, which prevents dust or water from entering the shaver and allows you to easily clean the trimmer under running water.", " 1", " Cordless, Rechargeable", " Foil", " Face, Head", " All Hair Types", " Unwanted Hair", " Electric", " Required, included: 1 alkaline AA", " Rinse with Water, Wipe Clean", " 2 Year Limited Warranty", " Adult Use Only"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/13470163?wid=410&hei=410"], "product_item_num": "13470163", "list_price": "$34.99", "product_title": "Braun Cruzer 5 Beard and Head Trimmer"}
