{"product_url": "http://www.target.com/p/philips-norelco-rq10-52-replacement-head/-/A-10644640", "source_site": "target.com", "description": ["    \n  \t\t     \tThe Philips Norelco RQ10/52 arcitec Replacement Head Unit fits arcitec 1000 series shavers. To replace:  ", "  ", " 1) Switch off the shaver and disconnect it from the power outlet. ", " 2) Remove the Shaving Head Unit from the shaver by pulling the replacement head straight up away from the shaver.  ", " 3) Place new shaving head unit back on the shaver and push down until you hear a click.  The shaving head unit will only fit correctly in one position on shaver. Make sure to align the raised notch on the shaving head unit  with the slot inside the top of shaver.", "Target reserves the right to limit quantities per guest", " 1", " 1", " Replacement Blade", " Rotating Head", " Face", " All Hair Types", " Unwanted Hair", " Electric", " no battery used", " Rinse with Water", " 2 Year Limited Warranty"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/10644640?wid=410&hei=410"], "product_item_num": "10644640", "list_price": "$36.99", "product_title": "Philips Norelco RQ10/52 Replacement Head"}
{"product_url": "http://www.target.com/p/philips-norelco-hq9-52-replacement-head/-/A-10288922", "source_site": "target.com", "description": ["    \n  \t\t     \tPhilips Norelco HQ9/52 Replacement Heads fit the following shaver models: AT900 series, 8100 series, 8200 series, 9100 series. To replace the heads:  ", " 1) Switch off the shaver and disconnect it from the power outlet.  ", " 2) Press the release button to open the shaving unit.  ", " 3) Turn the lock anticlockwise and remove the retaining frame.  ", " 4) Remove the shaving heads and place new ones in the shaving unit.  ", " 5) Make sure that the projections of the shaving heads fit exactly into the recesses.  ", " 6) Put the retaining frame back into the shaving unit and turn the lock clockwise.  ", " 7) Close the shaving unit until you hear a click.             ", "  ", " Note: If the shaving unit does not close smoothly, check if you have inserted the shaving heads properly and if the retaining frame is locked.", "Target reserves the right to limit quantities per guest", "Set includes 3 heads", " 1", " 1", " Replacement Blade", " Rotating Head", " Face", " All Hair Types", " Unwanted Hair", " Electric", " no battery used", " Rinse with Water", " 2 Year Limited Warranty"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/10288922?wid=410&hei=410"], "product_item_num": "10288922", "list_price": "$29.49", "product_title": "Philips Norelco HQ9/52 Replacement Head"}
