ign, Washable, Wet/Dry, Detachable Head, Rechargeable", " Arms, Bikini Line, Under Arm, Legs", " All Hair Types", " Unwanted Hair", " Electric", " 40 Minutes", " Rinse with Water, Wipe Clean", " 2 Year Limited Warranty"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/13684679?wid=410&hei=410"], "product_item_num": "13684679", "list_price": "$104.99", "product_title": "Philips HP6576/50 Satin Perfect Deluxe Epilator"}
