{"product_url": "http://www.target.com/p/philips-norelco-caretouch-model-at790-40/-/A-15104474", "source_site": "target.com", "description": ["    \n  \t\t     \tThe new Phillips Norelco CareTouch Shaver (Model # AT790/40) is designed to provide maximum comfort by helping to reduce ingrown hairs and skin irritation. With three individually floating GentleCut shaving heads which cut just above skin level and a rotary comfort system, the Caretouch razor adjusts to every curve and contour of the face to create a smooth, seamless shave. Powered by a lithium-ion battery for long-lasting power, the razor is built with Aquatec, which allows you shave wet using your favorite gel or foam for optimal performance, or dry for convenience. The Caretouch razor\u2019s pop-up trimmer helps to keep sideburns and mustaches well-groomed, and is fully washable. It offers up to 40 minutes of cordless power, can be used while plugged in, and has a battery light indicator which displays when the battery is low, charging or full.", " 1", " Face", " All Hair Types", " Unwanted Hair", " Battery-Powered", " Required, included", " Rinse with Water", " 2 Year Manufacturer Warranty"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/15104474?wid=410&hei=410"], "product_item_num": "15104474", "list_price": "$59.99", "product_title": "Philips Norelco CareTouch (Model # AT790/40)"}
{"product_url": "http://www.target.com/p/panasonic-arc4-nanotech-4-blade-wet-dry-men-s-shaver/-/A-13785079", "source_site": "target.com", "description": ["    \n  \t\t     \tPanasonic electric shavers are packed with smart, innovative, features that deliver a remarkably close and comfortable shave.  ", "  ", " All Panasonic men\u2019s shavers are fully waterproof for wet/dry cordless operation. Use the shaver dry for a quick, smooth shave\u2014perfect for when you\u2019re in a hurry in the morning or want a quick touch up before going out in the evening\u2014or a luxurious, pampering wet shave with foam or gel. Because they're waterproof, you can enjoy the freedom of taking your shaver in the shower and the convenience of rinsing it clean under running water. ", "  ", " The ES-RF31-S has a 4-blade cutting system.  More foils means better coverage and reduced shaving time.  And since our foils feature varying configurations, they work together to capture hairs of different thickness or growing patterns. So you\u2019ll get a close, comfortable shave and finish more quickly. ", "  ", " The ES-RF31-S also has an ultra-thin vibrating outer foil which is a perforated, curved metal casing that covers the blades. Whiskers are cut when they enter the holes in the foil.The foil on a Panasonic shaver is incredibly thin \u2013 only 41 micrometers on select models \u2013 so the blades get closer while the foil protects your skin. Further, our shaver motors charge the foil with subtle yet rapid vibrations which gently lift the hair follicles for a closer cut while helping the shaver to glide even more smoothly across the skin. ", "  ", " Panasonic shavers feature ultra-sharp Nanotech\u2122 blades\u2014a name derived from a special nano-polishing technique used to shape the blade\u2019s leading edge. Nanotech\u2122 blades are honed at an acute 30\u00ba angle enabling whiskers to be cut more cleanly at the root. ", "  ", " The Multi-fit arc foil allows the shaver to glide uniformly over the chin and along the jaw line. The arc foil, also allows the shaver head to move in a circular motion\u2014ideal for those accustomed to a rotary shaver.", " 1 ", " 3 ", " Shaver, Protective Cover, Instruction Manual", " Immersible, Pivoting Head, Charge Indicator Light, Pop-Up Trimmer, Angle Shaving Foils, Wet/Dry, Rechargeable", " 4 ", " Face", " All Hair Types", " Unwanted Hair", " Battery-Powered, Electric", " Up to 1 Hour", " Rinse with Water", " 2 Year Limited Manufacturer Warranty"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/13785079?wid=410&hei=410"], "product_item_num": "13785079", "list_price": "$73.99", "product_title": "Panasonic Arc4 Nanotech 4-Blade Wet/Dry Men's Shaver"}
{"product_url": "http://www.target.com/p/mangroomer-professional-do-it-yourself-electric-back-hair-shaver/-/A-12711035", "source_site": "target.com", "description": ["    \n  \t\t     \tThe MANGROOMER PROFESSIONAL Do-It-Yourself Electric Back Hair Shaver is the newest and most advanced back shaver available for men to quickly and easily eliminate their back hair. It patented design features a PROFESSIONAL handle you can extend and lock at any length you choose by engaging the PROFESSIONAL lock button on the handle, which enables you to create your perfect custom shaving length. The extreme reach of the shaver measures over two feet in length when fully extended, allowing you to reach even the most difficult middle and lower portions of the back.  The PROFESSIONAL has a new rechargeable battery power for quick-charging and operates at optimum power between charges. Additional new features include the 100% non-slip rubberized grip along the handle and body that allows for maximum maneuverability and increased control at any shaving angle. The PROFESSIONAL's premium blade design delivers superior smooth shave results and measures 1.5 inches in width for maximum coverage and fewer strokes. The sleek, lightweight, and compact design folds flat for storage and travel. Accessories included are a new protection cap, a cleaning brush, an A/C recharging adaptor, and an instruction booklet.", "Target reserves the right to limit quantities per guest", " 1", " Foil", " Multicultural, All Hair Types", " Unwanted Hair", " Electric", " optional, included", " Up to 3 Hours", " Rinse with Water, Wipe Clean", " 30 Day Limited Manufacturer Warranty", " no warning applicable"], "image_urls": ["http://scene7.targetimg1.com/is/image/Target/12711035?wid=410&hei=410"], "product_item_num": "12711035", "list_price": "$29.99", "product_title": "MANGROOMER Professional Do-It-Yourself Electric Back Hair Shaver"}
